Jung Dayeon, a webtoon artist and a cat owner saves a young heir from a dog and the next day suddenly a butler appears at her house, what's more the butler has cat ears and a tail?!

&quot;I am Nyangjji from Planet Nya, a planet far from Earth. I have been ordered to be a servant here for one year.&quot;

A hilarious human documentary about cat butlers that appeared out of nowhere.

&quot;--Do you have anything that you would risk your life to protect?&quot;
&quot;I do.&quot;

I'm Jonouchi Hatoko, age 30. As a result of protecting with my body the doujinshi more important to me than my life, I realized that I had traveled through time. Back to 1996, when I was 13 years old.

&quot;I never heard about this, life--!&quot;

Dashing through my second chance at life with the body of a 13-year-old and the heart of a 30-year-old, a &quot;positive time slip legend&quot;!

She is the well-known young lady of the Prime Minister&rsquo;s mansion. However, because of a single promise, she ran into a statue and died.
21st century&rsquo;s Mu QingGe transmigrates into her dead body. Relying on her mastery of medicines and poisons, she causes a disturbance in the Imperial Court.

&quot;I will let you know what it means to be called a fool! Let you know what is true incomparable beauty is!&quot; 
She stood in the limelight amidst the waves, overlooking the whole world. 

Many beautiful men swarmed around her but only one of them stood tall. Standing, with his long sleeves, in an imposing manner, &quot;Woman, Jiang Shan is yours, and you are mine.&quot;

Adapted from a novel written by Qiao Xiao Xi.

I&rsquo;d been reincarnated as the heroine of a predictable third-rate harem novel. I decided to live as the heroine and enjoy my comfortable life with the hero&hellip; but what kind of romance is this?! Having a soldier for a boyfriend, there was a constant stream of women surrounding him&hellip; and all kinds of incidents occurred. So now I was trying my best to live a normal life. I broke up with my boyfriend and married a man I&rsquo;d met during a blind date but&hellip; What? My husband is the demon king?

&ldquo;Ha, what do you have your guard up for? Are you scared that I&rsquo;m going to do something to you? I can see that you&rsquo;re scared.&rdquo;

&ldquo;Why would I be scared?&rdquo;

&ldquo;What?&rdquo;

&ldquo;What would you be able to do to me? Don&rsquo;t flatter yourself, I&rsquo;m just uncomfortable.&rdquo;

&ldquo;I want you to be mine, but that seems to be impossible.&rdquo;

&hellip;. No matter how much I think about this, everything seems to be wrong.

&ldquo;Encontr&eacute; un gran pene (Amante) destinado&rdquo;
Un chico de coraz&oacute;n puro con un complejo virgen x El m&aacute;s caliente prostituto en busca del pene ideal.
Suno &iexcl;Hoy tambi&eacute;n est&aacute; trabajando duro para TNK buscando en el ba&ntilde;o p&uacute;blico y por fin encontr&oacute; a una persona ideal! Fue Otake, que recientemente se mud&oacute; al apartamento de al lado. A pesar de que comienza a ser atacado r&aacute;pidamente, le preocupa que lo tome como una tonter&iacute;a. Sin embargo, un d&iacute;a, encuentra a Otake frustrado por una novia, as&iacute; que Suno usa su cuerpo para consolarlo&hellip;?!

God gave me a chance to relive my life. Before the rebirth, I had been used for the past 400 years as the empire's sword. And so, I swore to destroy the empire. I found the young prince of the country and became his teacher. I taught him how to become a tyrant and asked for the country.

&quot;I will do the lady's will.&quot;

He conquered the whole empire for me, and I ran away.

&quot;I came to take you, Charlize Ronan.&quot; Dylan became a perfect tyrant and searched the entire empire for me.

&quot;You tamed me, so why did you run away?&quot;

Ji-Woo Lee, an author gets reincarnated into her novel as Tara Elias, the 5th daughter of the Elias family. However, the family is supposed to fall soon, and everyone in it will be executed. Ji-Woo insists that she will escape her fate.

&quot;I thought everything was going smoothly.&quot;

That is, until she meets the second prince. Prince Kyle Amur.

I said, &quot;Can't we just call each other by our first name?&quot;
This is a small Yuri story.
It is a sequel, but it is a complete piece so you can read just this book.

&quot;When I got fired from my job, I went to a different world...&quot;

Fujioka Noelle is a hard worker for a black company, but her efforts go unrewarded when she is handed a notice of dismissal one day. Frustrated and sinking into despair, she was suddenly transported to another world...

In front of the bewildered Noelle appeared Fenrir, the large, silvery-white wolf. Taking a liking to her, they took her into their care as their 'beloved daughter.' Before long, in the midst of her healing, she became caught up in events that will change the world...

After dying from a strange terminal illness, Ling Lan was reborn into a world 10,000 years into the future. Although she dearly wished she could just live a peaceful and uneventful life in her new healthy body, fate had other plans&hellip;

Forced to disguise herself as a boy just so she could inherit her deceased father&rsquo;s premium military benefits, Ling Lan&rsquo;s journey to adulthood was full of challenges. After much difficulty, she finally turned sixteen when she could drop the charade. But before she could grasp her newfound freedom to get married and start her own family, a twist of fate results in her being thrown into the Federation&rsquo;s top military boys&rsquo; school.

With these twists of fate, Ling Lan had little choice but to walk further and further down a path of no return, one of cold and aloof dominance&hellip; (NovelUpdates)

&quot;...I'm screwed.&quot;

On a normal day like any other, Duchess Juliana Auburn woke up from a dream. No, rather, it is I, &quot;Lee Sian,&quot; who remembered my past life.

Juliana Auburn was a character in a novel who did nothing but badmouth and find fault with her husband, his friends, and her own father who had forced her to marry an illegitimate man.

According to a spoiler comment that she read, she will be killed at the start of the novel.

&quot;Why did I only remember everything now after I've already done all of those bad things to the male lead?!&quot;

In order to avoid the novel's &quot;bad ending,&quot; Juliana plans to divorce her husband, Evan, the male lead....

&quot;I'll give you everything you want.&quot;

&quot;Don't you know that the one who falls in love first loses?&quot;

&quot;Why should I apologize for staring at you because you're so pretty?&quot;

...Isn't my husband's obsession more serious than I thought?

Promo based on the [url=https://series.naver.com/novel/detail.nhn?productNo=4754414]webnovel[/url]

Manga written by Nemu Youko after she'd given birth to her daughter in 2018, published eight months later. It reflects on her own experience of pregnancy through lives of fictional couple Kiri and Muchan, two people in their 30's with already established routines, careers, and comfortable everyday dynamic, who after years of half-hearted discussions and tiptoeing around the subject find themselves expecting a child.

Complimented by a conversation with another mother working editorial in the manga industry, published online.

&quot;This book is for pregnant women, those who were pregnant, those who will soon become pregnant, those who are wondering if they should become pregnant, those who do not want to become pregnant, those who are not interested in pregnant women, those who have pregnant women around, and those who are close to pregnant women This is a book that any person who's been born can read. Thank you.&quot;

Girls are creatures that are full of mysteries. In a dilapidated dormitory for girls, Yachiko who has run away from home meets Giko, the crevice ghost. Peeping on and observing girls, that is Giko's goal, all to unravel the mysteries that is a girl and to note them in his &quot;Girls Dictionary?!&quot;

Link to the author's animations on their website:
http://amagoyasairuiu.web.fc2.com/link.html

The child of a prophecy is born to save the world.
&quot;I need to get married to save people...? I'll do the marriage!&quot; 
The emperor is a young and innocent boy. But...
&quot;I can't give you my daughter! She will not be becoming empress.&quot;
My father interfered with my marriage!
&quot;Is my sister just a toy to you?&quot;
And my brother too!
Will I be able to save the world?

This is a oneshot promotional manhwa for the novel of the same name

I am the villainess in a harem novel. My role as &quot;Erika&quot;  is to be an evil ex-girlfriend. I don't want to be a dumb villainess, so I broke up with the male-lead first... But after 3 years, Leo came back to me. 

&quot;I can't live without you. I still like you...&quot;

I'm not the girl you should be obsessed with?! The second leads also came to me.

&quot;I like it when you're next to me...&quot; 

I'm just a supporting villainess, yet why are all these men confessing to me?! Who should I choose?

I became the main character who beats around the bush in an angsty romance fantasy novel.
The role of the heroine who gets thrown by the ML and is ignored by her best friend.
It can&rsquo;t go this way! I have to change the original route by all means.

&ldquo;Please employ me as your support.&rdquo;

To survive, I decided to stick to the antagonist, the crown prince, of the original plot.
However, this man is in no way going as planned. 
To add, even a weird rumour is going around. 

That I and Palus are lovers, with plans of wedding ahead.

&ldquo;We&rsquo;re not lovers. It&rsquo;s just me who cannot live without her.&rdquo;

Huh? What is this guy saying right now!
Why is he adding fuel to the fire!
[hr]&ldquo;Crown Prince, the King said&hellip;&hellip;&rdquo; 

What of these bad rumours, this much I expected once I decided to be the Crown Prince&rsquo;s support.

&ldquo;you have fallen for Noo-nim and that you cannot come to your senses.&rdquo;

However, that wasn&rsquo;t true. False rumours must have morality! In fact, he likes men!

&ldquo;That being blind to jealousy, you broke the wrist of a man, getting close to Noo-nim on spot.&rdquo;
&ldquo;......&rdquo;

No, I mean that&rsquo;s not completely untrue. But, that might not be the reason&hellip;&hellip;

&ldquo;I also heard rumours that you might officially marry Noo-nim soon.&rdquo;
&ldquo;......&rdquo;

No. That&rsquo;s never true!
[hr][i]Note: This is a oneshot promotional manhwa for the novel of the same name [/i]

I reincarnated as the villainess in a novel I had read, Jubellian Eloy Floyen. I was doomed to die, but no! With the memories of my previous life, I will avoid my death flag!

&ldquo;I will not marry a man who has no honor, no family, no property, and no power!&rdquo;

As I declared my will to live a glorious and glamorous life, my Dad decided to make the crown prince my fianc&eacute;?! Is he Mad?! I&rsquo;ll just treat the engagement contract as a last measure.

&ldquo;Why are you avoiding your engagement with the Crown Prince?&rdquo;

&ldquo;Because it scares me! He kills people who don&rsquo;t obey him right away!&rdquo;

A few days later the Crown Prince sent me a letter. &ldquo;Don&rsquo;t worry, I won&rsquo;t kill you.&rdquo;

Oh no&hellip; did I already do something worth dying for?

Hiroshi is shocked when he finds out that his imaginary friend, Enigami, isn&rsquo;t so imaginary after all! Then he realizes his beastly companion can battle it out with other kids&rsquo; imaginary friends, and things start to get even stranger. But when these playground games turn serious and kids start disappearing, Hiroshi realizes that the consequences here might be more real than he first thought&hellip;

