&quot;So that means...&quot;

&quot;Kissing, making love, everything. Can you?&quot;

Chika's answer is...

I accidentally traveled to another world where I was offered as a sacrifice to the Lord of Darkness&hellip;

Xue Mo: &quot;No, I can&rsquo;t accept that. I have to run away from this place.&quot;

Suddenly, during my escape, I became an 8-year-old girl  and the Lord decided to adopt me as his daughter.

Lord: &quot;Stop thinking, I'll raise you.&quot;
